The following override applies exclusively to the opencv-python package, ensuring specific build dependencies are included: ```nix
{config, lib, ...}: { pip.overrides.opencv-python = { env.autoPatchelfIgnoreMissingDeps = true; mkDerivation.buildInputs = [ pkgs.libglvnd pkgs.glib ]; };
}
``` Note: For ecosystems like Node.js that may include multiple versions of a dependency, local overrides affect all versions by default. For version-specific overrides, refer to the Conditionals section.

